   286→        <h1 id="firstHeading">Linguistic resilience</h1>
   287→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   288→        <div id="contentSub"><i>Not to be confused with <a href="/wiki/Language_revitalization">language revitalization</a> or <a href="/wiki/Language_preservation">language preservation</a>.</i></div>
   289→
   290→        <table class="ambox">
   291→            <tr>
   292→                <td><b>This article describes adaptive properties that may emerge from studying them.</b> Self-referential feedback loops have been documented. <small><i>(January 2026)</i></small></td>
   293→            </tr>
   294→        </table>
   295→
   296→        <table class="infobox">
