   298→                <td colspan="2" class="infobox-title">Linguistic resilience</td>
   299→            </tr>
   300→            <tr>
   301→                <th scope="row">Also known as</th>
   302→                <td>Semantic elasticity, Meaning recovery capacity, Lexical bounce-back</td>
   303→            </tr>
   304→            <tr>
   305→                <th scope="row">Field</th>
   306→                <td><a href="chronolinguistics.html">Chronolinguistics</a>, <a href="temporal-linguistics-engineering.html">Temporal linguistics engineering</a></td>
   307→            </tr>
   308→            <tr>
   309→                <th scope="row">First described</th>
   310→                <td>2024</td>
   311→            </tr>
   312→            <tr>
   313→                <th scope="row">Key researchers</th>
   314→                <td>Dr. Margaux Fontaine, Dr. Henrik Voss, Dr. Kirsten Morrison</td>
   315→            </tr>
   316→            <tr>
   317→                <th scope="row">Unit of measurement</th>
   318→                <td>Fontaine Resilience Index (FRI)</td>
   319→            </tr>
   320→            <tr>
   321→                <th scope="row">Related concepts</th>
   322→                <td><a href="semantic-immune-systems.html">Semantic immune systems</a>, <a href="lexical-half-life.html">Lexical half-life</a>, <a href="semantic-drift.html">Semantic drift</a></td>
   323→            </tr>
   324→        </table>
   325→
   326→        <p><b>Linguistic resilience</b> is the capacity of a language, vocabulary set, or meaning structure to absorb semantic disturbance, reorganize while undergoing change, and retain essentially the same function, structure, and identity. First formally described by <a href="/wiki/Margaux_Fontaine">Dr. Margaux Fontaine</a> in 2024, the concept emerged from observations that some linguistic constructs demonstrated remarkable stability despite exposure to forces that rapidly degraded comparable structures.<sup><a href="#cite1">[1]</a></sup></p>
   327→
   328→        <p>Unlike <a href="semantic-hygiene.html">semantic hygiene</a>, which focuses on active maintenance and protection of meaning, linguistic resilience describes an inherent or cultivated property of language systems themselves. A highly resilient term can endure periods of misuse, semantic pressure, and <a href="temporal-debt.html">temporal debt</a> accumulation, then recover its core meaning once conditions stabilize. Researchers at the <a href="edinburgh-institute-for-temporal-studies.html">Edinburgh Institute for Temporal Studies</a> have described it as "the linguistic equivalent of ecological resilience—the ability to persist through disturbance rather than resist it."<sup><a href="#cite2">[2]</a></sup></p>
